import React from 'react'

function Rating(value, text, color) {
  return (
    <div className='rating'>
        <span>
        {value}, {color}
            <span>
                <i style={{ color: "#F8E825" }} className={
                    value >= 1
                        ? "fas fa-star"
                        : value >= 0.5
                            ? "fas fa-star-half-alt"
                            : "far fa-star"
                }>

                </i>
            </span>
        </span>
    </div>
  )
}

export default Rating
